CREATE TABLE `elementosderede` (
  `id_equipamento` int(11) NOT NULL AUTO_INCREMENT,
  `equipamento` varchar(24) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT 'sigla do equipamento',
  `descricao` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'Descrição do Equipamento',
  `ip` char(18) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'ip de rede',
  `firmware` char(20) COLLATE utf8_unicode_ci DEFAULT '0',
  `estacao` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'Nome da estação de instalação',
  `tipo` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'Tipo do equipamento',
  `status` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'Situação do equipamento',
  `arco` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'Numero do arco',
  `cluster` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'numero do cluster',
  PRIMARY KEY (`id_equipamento`)
) ENGINE=InnoDB AUTO_INCREMENT=1413 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Relação de elementos de rede';
